import React, { Component } from 'react'

export class LinkedInLogin extends Component {
  render() {
    return (
      <div>
        <p>Hello from LinkedIn Login</p>
        <a href="#" style={linkedin_btn}className="waves-effect waves-light btn-large"><i class="fab fa-linkedin 7x"></i>  Login with LinkedIn</a>
      </div>
    )
  }
}

const linkedin_btn={
  backgroundColor: '#0077b5',
  fontSize: '20px'
}


export default LinkedInLogin
